import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import { useNavigate } from "react-router-dom";
import { useCookies } from 'react-cookie';

const Header = () => {
const [cookies, setCookie, removeCookie] = useCookies();

const Logout = () => {
    removeCookie("token");
    }

    return( 
    <>
        <Wrapper>
            <></>
            <LogoDiv>Entry DSM</LogoDiv>
        <Sort>
        {!localStorage.getItem("token") &&
            (<>
                <Font><ColorWhite>로그인</ColorWhite></Font>
                <Font><ColorWhite>회원가입</ColorWhite></Font>
            </>
            )}
            {localStorage.getItem("token") && 
            (<>
            <Font><ColorWhite>글쓰기</ColorWhite></Font>
            <Font><ColorWhite>마이페이지</ColorWhite></Font>
            <Font><ColorWhite onClick={Logout}>로그아웃</ColorWhite></Font>
            </>
                )}
            </Sort>
        </Wrapper>
        </>
        )
    }

export default Header

const LogoDiv = styled.div`
    color: white;
`

const ColorWhite = styled.div`
    color: white;
    cursor: pointer;
    text-decoration: none;
`

const Wrapper = styled.div`
    width: 100vw;
    display: flex;
    align-items: center;
    justify-content: space-between;
    border: 0px solid black;
    background-color: #000000cf;
`

const Sort = styled.div`
    display: flex;
    margin-right: 35px;
`

const Font = styled.div`
    margin-left: 15px;
    font-size: 20px;
    font-family: 'DoHyeon';
`
